import React from 'react';

function CategoryList(){
const category = ['Seafood ', 'Beef ', 'Port ','Chicken ','Vegetable']

    return (

       <React.Fragment>
           {
               category.map( category=>{
                   return <a href=''>{category}</a>
               })
           }
       </React.Fragment>

    )
}

export default CategoryList
